import React from 'react';
import { Link } from 'react-router-dom';

const TopicPage = () => {
  return (
    <div className="app-wrapper">
      <h1>Cybersecurity Topics</h1>
      <ul>
        <li>
          <Link to="/quiz/phishing">Phishing Attacks</Link>
        </li>
        <li>
          <Link to="/quiz/passwords">Password Security</Link>
        </li>
        <li>
          <Link to="/quiz/social">Social Engineering</Link>
        </li>
      </ul>
    </div>
  );
};

export default TopicPage;
